import axios from "axios";

const API_URL = "http://localhost:5000/api/auth";

export const login = async (email:string,password:string)=>{
    return axios.post(API_URL + "/login",{
        email,
        password,
    }).then((response)=>{
        console.log(response,"response");
        return response;
    });
}
export const registration = async (firstname:string,lastName:string,email:string,password:string,phoneNumber:string,confirmPassword:string)=>{
    return axios.post(API_URL + "/login",{
        email,
        password,
    }).then((response)=>{
        console.log(response,"response");
        return response;
    });
}
